  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:48.058788\",\n\t\"name\": \"field-observations-on-unimak-island-alaska-11-25-august-1975-field-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the observations
  of a two week reconnaissance of Unimak Island from 11 August-25 August, 1975. The
  primary objectives were to do a preliminary study of the populations of marine species
  in the pass with emphasis on techniques of population assessment and limitations
  inherent in species or group identification from shore. Furthermore, an evaluation
  of the potential of establishing radar monitoring of bird migration was made, especially
  with regard to logistics and problems which could be encountered in establishing
  a semi-permanent field station on the island. Incidental to these major goals, this
  opportunity was taken to collect marine birds, band, survey the beaches for beached
  birds, identify roosting and breeding areas of marine birds, and assess marine mammal
  populations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
